import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const MyNavbar = () => {
  const scrollToSection = (id) => {
    const section = document.getElementById(id);
    if (section) {
      section.scrollIntoView({ behavior: "smooth" });
    }
  };

  return (
    <Navbar expand="lg" className="navbar-light bg-light" sticky="top"> {/* Expand on large screens and sticky for visibility */}
      <Container>
        <Navbar.Brand href="#home">MyPortfolio</Navbar.Brand> {/* Logo or brand name */}
        <Navbar.Toggle aria-controls="basic-navbar-nav" /> {/* Hamburger menu for mobile */}
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto"> {/* Navbar items aligned to the right */}
            <Nav.Link onClick={() => scrollToSection("about")}>About</Nav.Link>
            <Nav.Link onClick={() => scrollToSection("skills")}>Skills</Nav.Link>
            <Nav.Link onClick={() => scrollToSection("projects")}>Projects</Nav.Link>
            <Nav.Link onClick={() => scrollToSection("contact")}>Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default MyNavbar;
